import React, { useEffect } from "react";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import { setToken } from "./api/api";

import ProductList from "./components/ProductList";    // garde ton composant existant
import ProductDetail from "./components/ProductDetail";
import CheckoutForm from "./components/CheckoutForm";
import LoginPage from "./pages/Login";
import AdminPage from "./pages/AdminPage";
import SellerPage from "./pages/SellerPage";

function Header(){
  const role = localStorage.getItem("role");
  const email = localStorage.getItem("email");
  const items = JSON.parse(localStorage.getItem("cart") || "[]").length;

  const logout = () => {
    localStorage.removeItem("token");
    localStorage.removeItem("role");
    localStorage.removeItem("email");
    window.location.href = "/";
  };

  return (
    <header style={{ display:"flex", justifyContent:"space-between", alignItems:"center", padding:"0.75rem 1rem", background:"#222", color:"#fff" }}>
      <Link to="/" style={{ color:"#fff", textDecoration:"none", fontWeight:"bold" }}>Sneakers Shop</Link>
      <nav style={{ display:"flex", gap:12, alignItems:"center" }}>
        <Link to="/" style={{ color:"#fff" }}>Catalogue</Link>
        <Link to="/checkout" style={{ color:"#fff" }}>Paiement</Link>
        {role === "admin" && <Link to="/admin" style={{ color:"#fff" }}>Admin</Link>}
        {(role === "seller" || role === "admin") && <Link to="/seller" style={{ color:"#fff" }}>Vendeur</Link>}
        {email ? (
          <>
            <span style={{ opacity:0.8 }}>{email}</span>
            <button onClick={logout}>DÃ©connexion</button>
          </>
        ) : (
          <Link to="/login" style={{ color:"#fff" }}>Connexion</Link>
        )}
        <span>Panier ({items})</span>
      </nav>
    </header>
  );
}

function PrivateRoute({ children, allow }){
  const token = localStorage.getItem("token");
  const role  = localStorage.getItem("role");
  if (!token) return <div style={{ padding:20 }}>AccÃ¨s refusÃ© â <a href="/login">connecte-toi</a>.</div>;
  if (allow && !allow.includes(role)) return <div style={{ padding:20 }}>AccÃ¨s interdit (rÃ´le insuffisant).</div>;
  return children;
}

export default function App(){
  // remet le token axios Ã  chaque refresh
  useEffect(()=>{ const t = localStorage.getItem("token"); if (t) setToken(t); },[]);

  return (
    <BrowserRouter>
      <Header />
      <div style={{ padding: "1rem" }}>
        <Routes>
          <Route path="/" element={<ProductList />} />
          <Route path="/product/:id" element={<ProductDetail />} />
          <Route path="/checkout" element={<PrivateRoute allow={["user","seller","admin"]}><CheckoutForm /></PrivateRoute>} />
          <Route path="/login" element={<LoginPage />} />
          <Route path="/admin" element={<PrivateRoute allow={["admin"]}><AdminPage /></PrivateRoute>} />
          <Route path="/seller" element={<PrivateRoute allow={["seller","admin"]}><SellerPage /></PrivateRoute>} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}
